var tipuesearch = {"pages": [{'title': 'about', 'text': '', 'tags': '', 'url': 'about.html'}, {'title': 'vocabulary', 'text': 'The_Oxford_5000.pdf \n cambridge_english_vocabulary_list.pdf \n', 'tags': '', 'url': 'vocabulary.html'}, {'title': 'GPT', 'text': 'Q:轉動慣量的公式 \n A: 轉動慣量（也稱為慣性矩）是描述物體繞著軸旋轉時對旋轉運動的抵抗程度的物理量。不同形狀的物體其轉動慣量的計算公式不同，以下是一些常見形狀物體的轉動慣量公式： \n \n \n 點狀物體（質點）： 對於質點，其轉動慣量為零，因為點狀物體在旋轉時並無具體的形狀和尺寸。 \n \n \n 直線棒（長度為L，質量為m，繞著一端垂直軸旋轉）： 轉動慣量的公式為：I = (1/3)mL^2 \n \n \n 環狀物體（內半徑為r1，外半徑為r2，質量為m）： 轉動慣量的公式為：I = (1/2)m(r1^2 + r2^2) \n \n \n 球體（半徑為r，質量為m）： 轉動慣量的公式為：I = (2/5)m*r^2 \n \n \n 薄板（長度為L，寬度為w，質量為m，繞著平行於寬度軸旋轉）： 轉動慣量的公式為：I = (1/3)mL^2 \n \n \n 以上僅為一些常見形狀物體的轉動慣量公式，實際應用中可能還有其他形狀物體的轉動慣量需要使用不同的公式計算。注意，不同教材和文獻可能會使用不同的符號和單位來表示轉動慣量，使用時應留意公式的表達形式和單位的一致性。 \n \n Q:以長1公尺之板手的一端為支點,在扳手的正中心向下施力55牛頓,力與扳手垂直,則作用於扳手之力矩大小為多少 \n A:力矩是一種表示力作用於物體旋轉效果的物理量，計算公式為力矩 = 力 × 距離，其中力是作用於物體的力的大小，距離是力作用點到物體的旋轉軸的垂直距離。 \n 在這個問題中，給定的力是55牛頓，作用於扳手的正中心，並且垂直於扳手。因此，扳手的旋轉軸就是扳手的一端，並且力作用點到旋轉軸的距離為1公尺（扳手的長度）的一半，即0.5公尺。 \n 將這些值代入力矩的計算公式，可得： \n 力矩 = 55牛頓 × 0.5公尺 = 27.5牛頓·公尺 \n 所以，作用於扳手的力矩大小為27.5牛頓·公尺。 \n \n Q: 幫我用python寫個計算機 \n A: \n # 簡單的四則運算計算機 \n # 加法 def add(a, b):  return a + b \n # 減法 def subtract(a, b):  return a - b \n # 乘法 def multiply(a, b):  return a * b \n # 除法 def divide(a, b):  if b == 0:  return "錯誤：除數不能為零"  else:  return a / b \n # 輸入兩個數字 num1 = float(input("請輸入第一個數字: ")) num2 = float(input("請輸入第二個數字: ")) \n # 顯示選項 print("請選擇運算方式：") print("1. 加法") print("2. 減法") print("3. 乘法") print("4. 除法") \n # 讓使用者選擇運算方式 choice = input("請輸入選項（1/2/3/4）: ") \n # 進行運算並輸出結果 if choice == \'1\':  print("結果：", add(num1, num2)) elif choice == \'2\':  print("結果：", subtract(num1, num2)) elif choice == \'3\':  print("結果：", multiply(num1, num2)) elif choice == \'4\':  print("結果：", divide(num1, num2)) else:  print("錯誤：無效的選項") \n \n 這只是一個簡單的示例，可能還有許多需要改進和擴展的地方，例如錯誤處理、輸入驗證、界面設計等，視需求可以進一步進行改進。 \n', 'tags': '', 'url': 'GPT.html'}, {'title': 'TOEFL', 'text': 'TOEFL iBT測驗包含四個部分，考生必須在3個小時內完成全部測驗。 \n 閱讀測驗–評量考生在大學校園求學時，閱讀課堂上的教材及文章之理解能力。 聽力測驗–評量考生在大學校園中，對英語的口語聽力理解能力。 口說測驗–評量考生在大學校園的學術環境下、使用英語進行口語表達的能力。 寫作測驗–評量考生在大學校園的課堂上，能否適當的使用英語進行寫作的能力。 TOEFL iBT與TOEFL ITP有什麼不同？ \n 托福網路測驗(TOEFL iBT®)與托福紙筆測驗(TOEFL ITP®)二種測驗皆為ETS所研發的托福測驗，只是在測驗形態、測驗設備、題型及時間等執行測驗方式的不同，而二種托福測驗的出題大方向及測驗範疇相同，皆是針對個人的校園及學術英語能力進行評量，都是最有效的學術英語能力評量工具。由於二種測驗的後勤作業與成本並不相同，因此在測驗價格上也有很大的差別。 \n 托福紙筆測驗(TOEFL ITP®)是用紙、筆填寫答案卡方式，以選擇題方式測驗考生的聽力、文法結構與閱讀能力三大項目，目前不考口說與寫作。測驗對象是國際交換學生、條件式入學學生、語言學校、中等學校與成人學校的學生及大學國際化教育計劃的學生，而TOEFL ITP的成績也常做為社區學院與獎助計劃申請者之報名條件。完整測驗時間為115分鐘，測驗費用為新台幣1,200元。 \n 托福網路測驗(TOEFL iBT®)是現階段北美洲大學入學許可之認證考試，由原先之TOEFL CBT電腦型態測驗於2006年9月停辦後，所改制而成。托福網路測驗(TOEFL iBT®)是使用電腦與耳機麥克風，透過網路即時連線至ETS進行線上測驗，考試範圍涵蓋「聽、說、讀、寫」四項技能，並採取整合技能(Integrated Skills)方試測驗，完整測驗時間為3小時 ，測驗費用為美金235元（約新台幣6,900元）。 \n', 'tags': '', 'url': 'TOEFL.html'}, {'title': 'GRE', 'text': '\n 什麼是GRE考試？美國各科系研究所的入學考試 \n GRE全名為Graduate Record Examinations，是由GRE委員會委託美國教育測驗服務社ETS所主辦的美國研究所入學考試。GRE的一般適用對象為申請美國研究所（或博士）課程的學生，科系包含法律（碩士、JD）、MBA、商（管）學院專業型碩士（例如Finance、Marketing）、工程（Engineering）、科學（Science）、人文科學（Humanities），以及教育（Education）…等。除了申請者的大學成績、推薦信以及其他的備審文件（例如讀書計畫、申論題）外，GRE成績提供了美國各大學審核委員會（Admissions Committee）一個更客觀性的指標，來評估申請者就讀碩士（或博士）課程的資格與條件。 \n 除了GRE考試之外，部分學校也會要求申請人提供GRE Subject TEST的成績證明，但什麼是GRE Subject TEST呢？下一段將為你說明。 \n', 'tags': '', 'url': 'GRE.html'}, {'title': 'TOEIC', 'text': '', 'tags': '', 'url': 'TOEIC.html'}, {'title': 'TOEIC檢測簡介', 'text': '\xa0https://www.toeic.com.tw/toeic/listening-reading/about/introduction/ \n 多益英語測驗（TOEIC®）全名為Test of English for International Communication，是美國ETS®針對母語非英語人士所研發的英語能力測驗，全球每年有超過700萬人次報考。 \n 多益系列測驗（The TOEIC®Program）目前可於全球160個國家施測，至少為1萬4千個以上的企業客戶、教育單位及政府機構所採用。成績不僅具備信度與效度，也具有國際流通度，足以體現考生在實際溝通情境中的英語文能力。 \n TOEIC®Listening and Reading Test本身並沒有所謂的「通過」或「不通過」，而是客觀地將受測者的能力以聽力5～495分、閱讀5～495分、總分10～990分的指標呈現，受測者也可以自評現在的英語能力，進而設定學習的目標分數。 \n 在真實的職場與校園環境中，當需要以英語溝通時，透過多益系列測驗，成績使用單位能夠進一步掌握職員與學習者的能力現況。 \n 也因為多益系列測驗之國際流通度廣闊，眾多國內外企業、學校，皆採用多益系列測驗作為評核人才英語程度之標準。 \n TOEIC Listening and Reading Test 測驗簡介 \n 多益測驗於全球160個國家施測，為1萬4千個以上企業、教育單位及政府機構採用，用途廣泛，全球每年超過700萬人次報考，成績具信度、效度及國際流通度。 \n', 'tags': '', 'url': 'TOEIC檢測簡介.html'}]};